import React, { useEffect, useState } from 'react'

function PRDetails() {
    let [PRdata, setPRData] = useState([]);
    let tempData;
    useEffect(() => {
        fetch('http://localhost:5000/print-data')
            .then((response) => response.json())
            .then((data) => setPRData(data))
            .then(() => tempData = PRDetails);
    }, [])

  return (
    <table style={{ width: "80vw" }}>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>User Type</th>
          <th>Delete</th>
        </tr>
        {data.map((i) => {
          return (
            <tr>
              <td>{i.fname}</td>
              <td>{i.email}</td>
              <td>{i.userType}</td>
              <td>{i.location}</td>
              <td>{i.mobile}</td>
              <td>
                <FontAwesomeIcon
                  icon={faTrash}
                  onClick={() => sendQuery()}
                />
              </td>
            </tr>
          )})}
      </table>
  )
}

export default PRDetails
